import React from 'react';
import {Link, NavLink, useLocation} from 'react-router-dom';

// import axios from "axios";
// import React, { useState, useEffect } from "react";

import styled from "styled-components";
import top from "./images/top.png";
import SideBar from "./SideBar";
import {Button} from "react-bootstrap";
import axios from "axios";
import edit from "./images/edit.svg";



function MyPage() {
    //
    const pathName = useLocation().pathname;

    //
    let body = {

    };

    //
    const onSubmit = async () => {
        try {
            const response = await axios.post(
                "https://backend.alittlevanilla.kro.kr/member/signup",
                body,
                {
                    headers: { "Content-Type": "application/json" },
                }
            );
            console.log(response.data.code);
            if (response.data.code === 1000) {
                window.location.href = "/emailcheck";
            }
        } catch (e) {
            console.log(e);
        }
    };


    return (
        <>
            <SideBar/>
            <Wrap>
                    <TopContainer>
                        <Section>
                                <ProfileBoxContainer>
                                    <TopImg src={top}></TopImg>

                                    <TitelBox>홍길동 님
                                        <img
                                            className="profile-img"
                                            src={edit} />
                                    </TitelBox>

                                    <FormBlockBody>
                                        <InputTextSizeW>
                                            <EmailsButton
                                                type="button"
                                                onClick={() => {
                                                    onSubmit();
                                                }}
                                            >
                                                프로필 전환
                                            </EmailsButton>
                                        </InputTextSizeW>
                                    </FormBlockBody>

                                </ProfileBoxContainer>

                            {/*문구 */}
                            <TitelBoxContainer>
                                <Titel>나의 이용권</Titel>
                            </TitelBoxContainer>











                            {/*</Article>*/}
                        </Section>
                    </TopContainer>
            </Wrap>
        </>)
        ;
}

export default MyPage;




//전체 박스
const Wrap = styled.div`
    width: 100%;
    height: 100vh;
`;


//전체 감싸는 프로필 박스
const TopContainer = styled.div`
    width: 100%;
    height: 280px;
    position: relative;
    grid-template-columns: 10rem minmax(auto, 100%) min-content;
    column-gap: 2rem;
    padding: 40px 40px;
    background-color: rgb(25, 25, 25);
`;


// 프로필 감싸는 박스
const Section = styled.div`
    width: 1024px;
    margin: 0 auto;
    //display: flex;
    //justify-content: flex-start;
    margin-top: 22px;
`;

// 프로필 박스
const ProfileBoxContainer = styled.div`
    width: 600px;
    display: flex;
    align-items: flex-start;
    gap: 30px;
    border-right: 1px solid #1b1b1b;
    align-items: center;
`;


//나의 이용권 박스
const TitelBoxContainer = styled.div`
    width: 600px;
    display: inline-grid;
    border-right: 1px solid #1b1b1b;
    text-align: center;
    position: relative;
    justify-content: flex-start;
    margin-left: 15em;
`;

//나의 이용권-글씨
const Titel = styled.div`
    display: flex;
    color: #fff;
    font-family: 'SUIT-Regular' !important;
    font-size: 16px;
    text-align: left;
    font-weight: 500;
   
`;

// 프로필
const TopImg = styled.img`
    width: 170px;
`;

//홍길동 박스
const TitelBox = styled.div`
    color: #fff;
    font-family: 'SUIT-Regular' !important;
    font-size: 2rem;
    margin-bottom: 20px;
    text-align: left;
    font-weight: 500;
    font-stretch: normal;
    font-style: normal;
    letter-spacing: normal;
    text-align: left;
    z-index: 1;
    //margin-top: 65px;
    margin-right: 20px;
    align-items: center;
    position: relative;
    
    .profile-img{
        margin-left: 10px;
        opacity: 1;
        width: 45px;
        position: absolute;
        bottom: 0;
    }

`;



//프로필 전환 버튼
const EmailsButton = styled.button`

    padding: 0.5rem 0.833rem;
    font-size: 12px;
    text-align: center;
    background-color: transparent !important;
    border: 1px solid rgb(77, 77, 77);
    opacity: 0.7;
    color: #f4f4f4;
    margin-top: 1.8rem;
    border-radius: 2px;
    margin-left: 0.5rem;

    &:hover{
        border: solid 1px #1351f9;
        color: #1351f9;
    }

    &:active{
        border: solid 1px #ff27a3;
        color: #ff27a3;
    }
`;

// 전체 폼 박스
const FormBlockBody = styled.div`
  text-align: left;
    margin: 20px 0 0;
    outline: none;
    align-items: center;
`;

// 사용자 작성 구간
const InputTextSizeW = styled.div`
    
  &.formError {
    cursor: default !important;
  }
  display: block;
  width: 100%;
  margin-top: 10px;
  text-align: left;
  vertical-align: middle;
  box-sizing: border-box;
    outline: none;
`;
